import React from 'react';
import { Link } from 'react-router-dom';
import './auth.css';
import logo from '../assets/logo.png'; // Adjust path as needed

const Login = () => {
  return (
    <div style={{
      minHeight: '100vh',
      width: '100vw',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      background: 'linear-gradient(135deg, #181818 60%, #232323 100%)',
    }}>
      <form className="form" style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        <div className="logo-container">
          <img src={logo} alt="Logo" />
        </div>
        <p className="title">Login</p>
        <p className="message">Welcome back! Login to access your account.</p>

        <label>
          Email
          <input className="input" type="email" placeholder="Enter your email" required />
        </label>

        <label>
          Password
          <input className="input" type="password" placeholder="Enter your password" required />
        </label>

        <button className="submit">Login</button>

        <p className="signin">
          Don&apos;t have an account? <Link to="/signup">Sign Up</Link>
        </p>
      </form>
    </div>
  );
};

export default Login;
